selector_to_html = {"a[href=\"barcode.html#china-post\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Poste de Chine<a class=\"headerlink\" href=\"#china-post\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id29\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"barcode.html#matrix-2-of-5\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Matrice 2 sur 5<a class=\"headerlink\" href=\"#matrix-2-of-5\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id28\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"barcode.html#code-128\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 128<a class=\"headerlink\" href=\"#code-128\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id19\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"scanmode.html#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mode de d\u00e9tection automatique<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Lien vers cette rubrique\">#</a></h2><p>Dans le mode de d\u00e9tection automatique, le scanner d\u00e9tecte la luminosit\u00e9 de l\u2019environnement environnant. Lorsque la luminosit\u00e9 change, le scan est d\u00e9clench\u00e9. Le scan se termine lorsque le scan est r\u00e9ussi ou que le temps de scan d\u00e9passe le temps de travail unique. Peu importe si le dernier scan a \u00e9t\u00e9 r\u00e9ussi ou a \u00e9chou\u00e9, la luminosit\u00e9 de l\u2019environnement environnant sera \u00e0 nouveau d\u00e9tect\u00e9e.</p>", "a[href=\"barcode.html#reverse-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Symbologies inverses<a class=\"headerlink\" href=\"#reverse-symbologies\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"keyboard.html#keyboard-language\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Langue du clavier<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Obtenir la langue actuelle du clavier<a class=\"headerlink\" href=\"#get-current-keyboard-language\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"barcode.html#interleaved-2-of-5\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Intercal\u00e9 2 sur 5<a class=\"headerlink\" href=\"#interleaved-2-of-5\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id24\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"working.html#storage-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mode de stockage<a class=\"headerlink\" href=\"#storage-mode\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Envoi de donn\u00e9es<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#data-upload1\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"faq.html#question-4-the-scanner-beeps-five-times-when-a-button-is-pressed-how-can-i-solve-this-problem\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 4 : Le scanner \u00e9met cinq bips lorsqu\u2019un bouton est press\u00e9, comment puis-je r\u00e9soudre ce probl\u00e8me?<a class=\"headerlink\" href=\"#question-4-the-scanner-beeps-five-times-when-a-button-is-pressed-how-can-i-solve-this-problem\" title=\"Lien vers cette rubrique\">#</a></h2><p><strong>R\u00e9ponse:</strong> La batterie est faible et doit \u00eatre recharg\u00e9e avant de pouvoir \u00eatre r\u00e9utilis\u00e9e.</p>", "a[href=\"keyboard.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Param\u00e8tres du clavier<a class=\"headerlink\" href=\"#keyboard-settings\" title=\"Lien vers cette rubrique\">#</a></h1><h2>R\u00e9glages du cas<a class=\"headerlink\" href=\"#case-settings\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Normale<a class=\"headerlink\" href=\"#normal\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"barcode.html#codabar\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Codabar<a class=\"headerlink\" href=\"#codabar\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id12\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"scanmode.html#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mode de d\u00e9clenchement des touches<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Lien vers cette rubrique\">#</a></h2><p>Appuyez sur le bouton pour d\u00e9clencher la num\u00e9risation, et rel\u00e2chez le bouton pour terminer la num\u00e9risation. La num\u00e9risation se termine lorsque le scan r\u00e9ussit ou que le temps de lecture d\u00e9passe le temps de lecture unique.</p>", "a[href=\"barcode.html#ean-13\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">EAN-13<a class=\"headerlink\" href=\"#ean-13\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id1\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"faq.html#question-3-the-scanner-scans-successfully-beeps-three-times-and-fails-to-upload-data-how-can-i-solve-this-problem\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 3:Le scanner scanne avec succ\u00e8s, bip trois fois et ne t\u00e9l\u00e9charge pas de donn\u00e9es. Comment puis-je r\u00e9soudre ce probl\u00e8me ?<a class=\"headerlink\" href=\"#question-3-the-scanner-scans-successfully-beeps-three-times-and-fails-to-upload-data-how-can-i-solve-this-problem\" title=\"Lien vers cette rubrique\">#</a></h2><p><strong>R\u00e9ponse:</strong></p>", "a[href=\"process.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">\u00c9dition de donn\u00e9es<a class=\"headerlink\" href=\"#data-editing\" title=\"Lien vers cette rubrique\">#</a></h1><h2>Format de sortie<a class=\"headerlink\" href=\"#output-format\" title=\"Lien vers cette rubrique\">#</a></h2><p>Pour modifier le Format de Transmission de Donn\u00e9es de Scannage, scannez l\u2019un des huit codes \u00e0 barres correspondant au format souhait\u00e9.</p>", "a[href=\"barcode.html#code-93\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 93<a class=\"headerlink\" href=\"#code-93\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id17\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"barcode.html#industrial-2-of-5\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Industrie 2 sur 5<a class=\"headerlink\" href=\"#industrial-2-of-5\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id27\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"faq.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Foire Aux Questions<a class=\"headerlink\" href=\"#faq\" title=\"Lien vers cette rubrique\">#</a></h1><h2>Question 1 : Le scan est r\u00e9ussi, le buzzer sonne une fois, mais aucune donn\u00e9e n\u2019est t\u00e9l\u00e9charg\u00e9e ?<a class=\"headerlink\" href=\"#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\" title=\"Lien vers cette rubrique\">#</a></h2><p><strong>R\u00e9ponse:</strong> Le scanner est entr\u00e9 en mode stockage et doit scanner <a class=\"reference internal\" href=\"working.html#normal-mode\"><span class=\"std std-ref\">Mode Normal</span></a> pour r\u00e9cup\u00e9rer.</p>", "a[href=\"faq.html#question-5-scan-successful-uploaded-data-incorrect\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 5:Scan r\u00e9ussi, donn\u00e9es t\u00e9l\u00e9charg\u00e9es incorrectes ?<a class=\"headerlink\" href=\"#question-5-scan-successful-uploaded-data-incorrect\" title=\"Lien vers cette rubrique\">#</a></h2><p><strong>R\u00e9ponse:</strong></p>", "a[href=\"barcode.html#upc-e\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UPC-E<a class=\"headerlink\" href=\"#upc-e\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id9\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"process.html#quick-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Configuration rapide<a class=\"headerlink\" href=\"#quick-setup\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Ajouter un pr\u00e9fixe<a class=\"headerlink\" href=\"#id3\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Param\u00e8tres du syst\u00e8me<a class=\"headerlink\" href=\"#system-settings\" title=\"Lien vers cette rubrique\">#</a></h1><h2>Restaurer les param\u00e8tres par d\u00e9faut<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Lien vers cette rubrique\">#</a></h2><p>Lorsqu\u2019une erreur inconnue se produit sur le scanner, vous pouvez r\u00e9initialiser le scanner en restaurant les param\u00e8tres par d\u00e9faut.</p>", "a[href=\"barcode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Symbologies<a class=\"headerlink\" href=\"#symbologies\" title=\"Lien vers cette rubrique\">#</a></h1><h2>Symbologies inverses<a class=\"headerlink\" href=\"#reverse-symbologies\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"character.html#transmit-code-id-character\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Transmettre le code ID du personnage<a class=\"headerlink\" href=\"#transmit-code-id-character\" title=\"Lien vers cette rubrique\">#</a></h2><p>Un caract\u00e8re ID de code identifie le type de code d\u2019un code \u00e0 barres scann\u00e9. Cela peut \u00eatre utile lors du d\u00e9codage de plusieurs types de code. Le caract\u00e8re ID du code est ins\u00e9r\u00e9 entre le caract\u00e8re pr\u00e9fixe (si s\u00e9lectionn\u00e9) et le symbole d\u00e9cod\u00e9.</p>", "a[href=\"faq.html#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 1 : Le scan est r\u00e9ussi, le buzzer sonne une fois, mais aucune donn\u00e9e n\u2019est t\u00e9l\u00e9charg\u00e9e ?<a class=\"headerlink\" href=\"#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\" title=\"Lien vers cette rubrique\">#</a></h2><p><strong>R\u00e9ponse:</strong> Le scanner est entr\u00e9 en mode stockage et doit scanner <a class=\"reference internal\" href=\"working.html#normal-mode\"><span class=\"std std-ref\">Mode Normal</span></a> pour r\u00e9cup\u00e9rer.</p>", "a[href=\"system.html#battery-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Informations sur la batterie<a class=\"headerlink\" href=\"#battery-information\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"#h3-wireless-scanner-quick-setup-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Guide d\u2019installation rapide du scanner sans fil <strong>H3</strong><a class=\"headerlink\" href=\"#h3-wireless-scanner-quick-setup-guide\" title=\"Lien vers cette rubrique\">#</a></h1>", "a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">R\u00e9glages du volume<a class=\"headerlink\" href=\"#volume-settings\" title=\"Lien vers cette rubrique\">#</a></h2><p>Scannez le code de r\u00e9glage correspondant pour activer/d\u00e9sactiver l\u2019invite sonore du scanner</p>", "a[href=\"wireless.html#medium-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Vitesse moyenne<a class=\"headerlink\" href=\"#medium-speed\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"process.html#appendix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Annexe<a class=\"headerlink\" href=\"#appendix\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Codes \u00e0 barres num\u00e9riques<a class=\"headerlink\" href=\"#numeric-bar-codes\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"character.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Personnage<a class=\"headerlink\" href=\"#character\" title=\"Lien vers cette rubrique\">#</a></h1><h2>Param\u00e8tres de caract\u00e8re de fin<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Lien vers cette rubrique\">#</a></h2><p>Le caract\u00e8re de fin est ajout\u00e9 apr\u00e8s le d\u00e9codage des donn\u00e9es au format des donn\u00e9es d\u00e9cod\u00e9es + caract\u00e8re de fin.</p>", "a[href=\"process.html#suffix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Suffix<a class=\"headerlink\" href=\"#suffix\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Ajouter un suffixe<a class=\"headerlink\" href=\"#add-suffix\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"process.html#hide-set\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Cacher le jeu<a class=\"headerlink\" href=\"#hide-set\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Cacher les caract\u00e8res de d\u00e9part du code-barres<a class=\"headerlink\" href=\"#hide-barcode-start-chars\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"wireless.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Mode sans fil<a class=\"headerlink\" href=\"#wireless-mode\" title=\"Lien vers cette rubrique\">#</a></h1><p>Ce mode utilise le 2. Bande de fr\u00e9quence GHz pour la transmission de donn\u00e9es et repose sur la technologie de fr\u00e9quence radio (RF) qui se connecte \u00e0 l\u2019ordinateur via un r\u00e9cepteur USB et permet au scanner de se d\u00e9placer librement \u00e0 une certaine distance.</p>", "a[href=\"system.html#sleep-time\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Temps de sommeil<a class=\"headerlink\" href=\"#sleep-time\" title=\"Lien vers cette rubrique\">#</a></h2><p>En scannant le code de r\u00e9glage suivant, vous pouvez r\u00e9gler le scanner pour qu\u2019il passe en mode veille apr\u00e8s une certaine p\u00e9riode de temps o\u00f9 aucun code n\u2019est scann\u00e9, afin de r\u00e9duire la consommation d\u2019\u00e9nergie.</p>", "a[href=\"barcode.html#gs1-databar-limited-rss-limited\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Barre de donn\u00e9es GS1 Limit\u00e9e(RSS Limit\u00e9)<a class=\"headerlink\" href=\"#gs1-databar-limited-rss-limited\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id21\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Restaurer les param\u00e8tres par d\u00e9faut<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Lien vers cette rubrique\">#</a></h2><p>Lorsqu\u2019une erreur inconnue se produit sur le scanner, vous pouvez r\u00e9initialiser le scanner en restaurant les param\u00e8tres par d\u00e9faut.</p>", "a[href=\"working.html#normal-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mode Normal<a class=\"headerlink\" href=\"#normal-mode\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"wireless.html#high-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Haute Vitesse<a class=\"headerlink\" href=\"#high-speed\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"working.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Mode de travail<a class=\"headerlink\" href=\"#working-mode\" title=\"Lien vers cette rubrique\">#</a></h1><p>Dans la zone de travail en dehors de la port\u00e9e de la 2. R\u00e9cepteur G ou signal Bluetooth, vous pouvez activer le mode de stockage du scanner en suivant les \u00e9tapes d\u00e9crites ci-dessous. Dans ce mode, toutes les donn\u00e9es num\u00e9ris\u00e9es seront stock\u00e9es directement dans le scanner. Avant de t\u00e9l\u00e9charger les donn\u00e9es, il sera sauvegard\u00e9 en permanence dans le scanner afin que vous puissiez t\u00e9l\u00e9charger les donn\u00e9es lorsque le scanner est dans la plage de signal de r\u00e9ception.</p>", "a[href=\"wireless.html#one-to-one-pairing\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Appairage unique<a class=\"headerlink\" href=\"#one-to-one-pairing\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"barcode.html#gs1-databar-expanded-rss-expanded\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Barre de donn\u00e9es GS1 \u00e9tendue (RSS \u00e9tendu)<a class=\"headerlink\" href=\"#gs1-databar-expanded-rss-expanded\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id23\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"character.html#end-character-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Param\u00e8tres de caract\u00e8re de fin<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Lien vers cette rubrique\">#</a></h2><p>Le caract\u00e8re de fin est ajout\u00e9 apr\u00e8s le d\u00e9codage des donn\u00e9es au format des donn\u00e9es d\u00e9cod\u00e9es + caract\u00e8re de fin.</p>", "a[href=\"barcode.html#plessey-telepen\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Plessey/Telepen<a class=\"headerlink\" href=\"#plessey-telepen\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id34\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"scanmode.html#duplicate-barcode-detection-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Dupliquer les param\u00e8tres de d\u00e9tection de codes \u00e0 barres<a class=\"headerlink\" href=\"#duplicate-barcode-detection-settings\" title=\"Lien vers cette rubrique\">#</a></h2><h3>D\u00e9sactiver<a class=\"headerlink\" href=\"#id1\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"barcode.html#code-11\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 11<a class=\"headerlink\" href=\"#code-11\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id13\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"wireless.html#low-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Faible vitesse<a class=\"headerlink\" href=\"#low-speed\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"barcode.html#upc-a\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UPC-A<a class=\"headerlink\" href=\"#upc-a\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id5\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"barcode.html#gs1-databar-omnidirectional-rss-omnidirectional\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Barre de donn\u00e9es GS1 Omnidirectionnelle(RSS Omnidirectionnel)<a class=\"headerlink\" href=\"#gs1-databar-omnidirectional-rss-omnidirectional\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id22\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"wireless.html#receiver-keyboard-transmission-speed1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Vitesse de transmission du clavier du destinataire<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#receiver-keyboard-transmission-speed1\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"process.html#output-format\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Format de sortie<a class=\"headerlink\" href=\"#output-format\" title=\"Lien vers cette rubrique\">#</a></h2><p>Pour modifier le Format de Transmission de Donn\u00e9es de Scannage, scannez l\u2019un des huit codes \u00e0 barres correspondant au format souhait\u00e9.</p>", "a[href=\"scanmode.html#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mode continu<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Lien vers cette rubrique\">#</a></h2><p>Le scanner fonctionne en continu. Si le scan est r\u00e9ussi ou si le temps de scan d\u00e9passe le temps de travail unique, le scan actuel se termine. Si le temps d\u00e9passe le temps sp\u00e9cifi\u00e9, la prochaine analyse est automatiquement d\u00e9clench\u00e9e.</p>", "a[href=\"barcode.html#code-39\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 39<a class=\"headerlink\" href=\"#code-39\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id14\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"system.html#get-firmware-version\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Obtenir la version du Firmware<a class=\"headerlink\" href=\"#get-firmware-version\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"keyboard.html#case-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">R\u00e9glages du cas<a class=\"headerlink\" href=\"#case-settings\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Normale<a class=\"headerlink\" href=\"#normal\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"barcode.html#ean-8\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">EAN-8<a class=\"headerlink\" href=\"#ean-8\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#enable-disable\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"scanmode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Mode de scan<a class=\"headerlink\" href=\"#scan-mode\" title=\"Lien vers cette rubrique\">#</a></h1><h2>Mode de d\u00e9clenchement des touches<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Lien vers cette rubrique\">#</a></h2><p>Appuyez sur le bouton pour d\u00e9clencher la num\u00e9risation, et rel\u00e2chez le bouton pour terminer la num\u00e9risation. La num\u00e9risation se termine lorsque le scan r\u00e9ussit ou que le temps de lecture d\u00e9passe le temps de lecture unique.</p>", "a[href=\"barcode.html#msi\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">MSI<a class=\"headerlink\" href=\"#msi\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id30\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"process.html#prefix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pr\u00e9fixe<a class=\"headerlink\" href=\"#prefix\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Ajouter un pr\u00e9fixe<a class=\"headerlink\" href=\"#add-prefix\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"faq.html#question-2-the-scanner-scans-successfully-beeps-twice-and-can-upload-data-normally-what-is-going-on\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 2 : Le scanner scanne avec succ\u00e8s, bips deux fois et peut t\u00e9l\u00e9charger des donn\u00e9es normalement. Que se passe-t-il ?<a class=\"headerlink\" href=\"#question-2-the-scanner-scans-successfully-beeps-twice-and-can-upload-data-normally-what-is-going-on\" title=\"Lien vers cette rubrique\">#</a></h2><p><strong>R\u00e9ponse:</strong> La batterie du pistolet du scanner est faible et il invite \u00e0 le recharger.</p>"}
